export const SwitchIcon = ({
  className,
  title,
  state,
}: SwitchProps): React.ReactElement => {
  const handleOnChange = () => {
    state.setMap && state.setMap(!state.map);
    state.setGrid && state.setGrid(!state.grid);
  };
  return (
    <Switch
      checkedIcon={
        <div
          style={{
            display: "flex",
            alignItems: "center",
            height: "100%",
            width: 80,
            paddingLeft: 10,
            paddingRight: 10,
            fontSize: 15,
            color: "#fff",
          }}
        >
          {title?.on}
        </div>
      }
      uncheckedIcon={
        <div
          style={{
            display: "flex",
            alignItems: "center",
            height: "100%",
            marginLeft: -36,
            width: 80,
            paddingLeft: 10,
            paddingRight: 10,
            fontSize: 15,
            color: "#fff",
          }}
        >
          {title?.off}
        </div>
      }
      className={className}
      width={100}
      checked={(state.map ? state.map : state.grid) || false}
      onColor="#3D3D3D"
      offColor="#ff0000"
      onChange={handleOnChange}
    />
  );
};
